        elem.src = `https://cdn.discordapp.com/attachments/${shuffled[lastImageIndex]}.jpg`;

        preloadImages(
          `https://cdn.discordapp.com/attachments/${
            shuffled[lastImageIndex + 1]
          }.jpg`,
          `https://cdn.discordapp.com/attachments/${
            shuffled[lastImageIndex + 2]
          }.jpg`,
          `https://cdn.discordapp.com/attachments/${
            shuffled[lastImageIndex + 3]
          }.jpg`
        );

        lastImageIndex++;
      }

      document.addEventListener("DOMContentLoaded", function () {
        const elem = document.getElementById("random_image");
        document
          .getElementById("btn")
          .addEventListener("click", () => randomImage(elem));

        randomImage(elem);
      });
    </script>
